import React, { useEffect, useState } from 'react';
import { fetchJSON } from '../api';

export default function EmployeeForm({ employee = {}, departments = [], onClose }) {
  const [form, setForm] = useState({
    first_name: employee.first_name || '',
    last_name: employee.last_name || '',
    email: employee.email || '',
    salary: employee.salary || '',
    department: employee.department?._id || ''
  });
  const [error, setError] = useState('');

  useEffect(() => {
    setForm({
      first_name: employee.first_name || '',
      last_name: employee.last_name || '',
      email: employee.email || '',
      salary: employee.salary || '',
      department: employee.department?._id || ''
    });
  }, [employee]);

  async function handleSubmit(e) {
    e.preventDefault();
    try {
      const method = employee._id ? 'PUT' : 'POST';
      const url = employee._id ? `/employees/${employee._id}` : '/employees';
      await fetchJSON(url, { method, body: JSON.stringify(form) });
      onClose();
    } catch (err) {
      setError(err.message);
    }
  }

  return (
    <div>
      <h3>{employee._id ? 'Edit Employee' : 'New Employee'}</h3>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      <form onSubmit={handleSubmit}>
        <div className="form-row">
          <label>First Name</label><br />
          <input value={form.first_name} onChange={e => setForm({ ...form, first_name: e.target.value })} />
        </div>
        <div className="form-row">
          <label>Last Name</label><br />
          <input value={form.last_name} onChange={e => setForm({ ...form, last_name: e.target.value })} />
        </div>
        <div className="form-row">
          <label>Email</label><br />
          <input value={form.email} onChange={e => setForm({ ...form, email: e.target.value })} />
        </div>
        <div className="form-row">
          <label>Salary</label><br />
          <input type="number" step="0.01" value={form.salary} onChange={e => setForm({ ...form, salary: e.target.value })} />
        </div>
        <div className="form-row">
          <label>Department</label><br />
          <select value={form.department} onChange={e => setForm({ ...form, department: e.target.value })}>
            <option value="">Select Department</option>
            {departments.map(d => <option key={d._id} value={d._id}>{d.name}</option>)}
          </select>
        </div>
        <div style={{ marginTop: 8 }}>
          <button type="submit">Save</button>
          <button type="button" onClick={onClose} style={{ marginLeft: 8 }}>Cancel</button>
        </div>
      </form>
    </div>
  );
}
